sys_variable_value.value:
(function execute(inputs, outputs) {
    
    var distance = parseFloat(inputs.distance);
    var total_elevation_gain = parseFloat(inputs.total_elevation_gain);
    var moving_time = parseFloat(inputs.moving_time);
 
    var sum = distance + moving_time + total_elevation_gain;
    outputs.uniqueid = sum.toString();

    //gs.info("Output Sum: " + outputs.uniqueid);
})(inputs, outputs)

